import "../assets/css/Layout.css";

const Layout = (props) => {
  return (
    <React.Fragment>
      <MenuBar />

      <div id="Spacer"></div>
      <div className="canvas-wrapper">{props.children}</div>
      <div id="Spacer"></div>

      <Footer />
    </React.Fragment>
  );
};

export default Layout;
